insert into taro_card_table (id, description, dignity, lasso, name, suit)
    values ('1', 'Обозначает количество неограниченных потенциалов. Вы находитесь на пороге неожиданного и захватывающего нового приключения. Это может потребовать от вас совершить слепой прыжок веры. Будет полезный опыт, который будет способствовать вашему росту как человека. Новое приключение может быть буквальным и может включать в себя путешествие в новые земли или территории, которые вы никогда раньше не посещали.',
            '0', 'high', 'Дурак', null),
           ('2', 'Показывает, как ваши желания и желания могут быть реализованы с помощью решимости и силы воли. Когда эта карта появляется в вашем раскладе, вы можете быть уверены, что у вас есть стремление осуществить свои мечты. Просто помните, что вы сильны, и если вы создадите свой внутренний мир, внешний последует за вами. Тем не менее, вы должны сосредоточиться и сконцентрироваться на достижении своей мечты. Избавьтесь от любых ограничений и составьте подробный план, чтобы не сбиться с пути.',
            '1', 'high', 'Маг', null),
           ('3', 'Указывает время для обучения и прислушивания к вашей интуиции, а не для того, чтобы отдавать приоритет вашему интеллекту и сознательному разуму. Она говорит вам замедлиться и подумать о том, что вы узнали, и получить еще больше знаний, прежде чем принимать решение или действовать.  Ее совет — перестать беспокоиться о результате и довериться решению привратников.',
            '2', 'high', 'Верховная жрица', null),
           ('4', 'Императрица в чтении призывает вас соединиться со своей женской стороной. Это можно перевести по-разному — подумайте о творчестве, элегантности, чувственности, плодородии и воспитании. Она говорит вам быть добрее к себе и искать красоту и счастье в своей жизни. Императрица часто приносит сильные всплески творческой или артистической энергии. Эта творческая энергия может проявляться не только в форме живописи или художественного проекта, но и в других формах творческого самовыражения, таких как музыка или драма.',
            '3', 'high', 'Императрица', null),
           ('5', 'Император означает мужа, который постоянен и заслуживает доверия. Он уверен в себе, контролирует свои эмоции и является примером мужской энергии. Он — отцовская фигура в жизни, которая обеспечивает структуру и безопасность, создает правила и системы и передает знания. Как правитель он ведет твердой рукой и требует уважения и авторитета. При тщательном планировании, высокоорганизованном подходе и настойчивости Император может справиться с любой проблемой, с которой он столкнулся. Этот новый уровень мастерства не произойдет просто так. Вы должны преследовать свои цели так же, как это делает Император, структурировано, стратегически и с большим упорством.',
            '4', 'high', 'Император', null),
           ('6', 'Он советует вам поддерживать условные границы, которые считаются стандартным методом. Вместо того, чтобы изобретать и нарушать нормы, вы познакомитесь с определенными традициями, верованиями и системами, которые существуют уже довольно давно. Карта Таро Иерофант воплощает в себе обычный набор духовных верований и часто ассоциируется с религией и другими формальными идеологиями. Таким образом, эта карта предполагает, что вы узнали необходимые ценности из надежного источника, такого как наставник или духовный наставник.',
            '5', 'high', 'Иерофант', null),
           ('7', 'Может означать, что вам предстоит сделать важный выбор, который изменит вашу жизнь, или вы столкнетесь с дилеммой. Искушение часто является частью этого выбора или дилеммы. Вы можете чувствовать неуверенность в том, в каком направлении вам следует двигаться или кому доверять. Или вам, возможно, придется выбирать между противоречивыми и в равной степени объединяющими вариантами. Влюбленные советуют вам не идти автоматически по легкому пути (искушению).  Если вы столкнетесь с проблемой и мудро обдумаете ее, это приведет вас к большим вещам.',
            '6', 'high', 'Влюбленные', null),
           ('8', 'Колесница — это преодоление препятствий и достижение цели с помощью решимости, сосредоточенности и силы воли. Вы почувствуете мотивацию, амбициозность и контроль. Это поможет вам снова сдвинуть застойную ситуацию и преодолеть все трудности, которые могут встретиться на вашем пути. Просто сосредоточьтесь и верьте в свои способности, и вы добьетесь своей цели. Колесница говорит вам, что вас ждет триумф и что вы полностью контролируете его осуществление.',
            '7', 'high', 'Колесница', null),
           ('9', 'Сила указывает на то, что вы очень настойчивый человек и можете добиться всего, к чему стремитесь. Вы уверены в себе, и у вас нет проблем с тем, чтобы быть собой и говорить открыто. Карта также говорит вам, что у вас есть способность сохранять позитивный настрой, спокойствие и логически мыслить в стрессовых ситуациях, которые проверяют ваше терпение и силу. Будь то через сострадание, хитрость или понимание, Сила означает, что вы можете получить настоящий контроль над ситуацией, а не просто силу силой навязывать свою волю. Продолжайте вести себя так, и вы добьетесь успеха во всем, чего хотите.',
            '8', 'high', 'Сила', null),
           ('10', 'Отшельник олицетворяет мудрость, заработанную поиском высшей истины. Часто поиск ответов внутри требует времени наедине с небольшим количеством отвлекающих факторов. Это требует самоанализа и меньшей концентрации на чувствах. Хотя поначалу это может показаться немного пугающим, самостоятельный поиск истины может стать одним из самых полезных событий в жизни.',
            '9', 'high', 'Отшельник', null),
           ('11', 'Колесо Фортуны может раскрыть экстрасенсорные способности, как внутри вас, так и у кого-то из близких. Воспринимайте это как возможность узнать больше о себе и прислушаться к своей интуиции. Воплощайте свои мечты, теперь, когда ваша энергия согласуется с вашими духовными наставниками, ангелами и другими помощниками. Вы не можете контролировать силы Вселенной, но вы определенно можете расширить свое понимание своей роли в этой жизни и во Вселенной. Просто помните, что бояться нечего. Все будет работать согласно божественному вмешательству и времени.',
            '10', 'high', 'Колесо Фортуны', null),
           ('12', 'Справедливость представляет причину и следствие, а также сбалансированные мысли и действия. Бывают случаи, когда мы оказываемся жертвами чужого злого умысла. Если вас каким-либо образом обидели, правосудие прибудет, чтобы восстановить равновесие и порядок. Это не значит, что все будет происходить именно так, как вам хотелось бы. Однако вытягивание этой карты при чтении поддерживает поговорку «Все хорошо, что хорошо кончается».',
            '11', 'high', 'Справедливость', null),
           ('13', 'Повешенный представляет собой «выжидательную игру», которая часто является частью жизненного прогресса. Хотя мы редко радуемся тому, что застряли в подвешенном состоянии, бывают моменты, когда ничего нельзя сделать, и мы вынуждены оставаться на месте. Это часто требует жертвовать людьми и вещами, за которые мы предпочли бы держаться. Карта Таро Повешенный хочет, чтобы вы знали, что иногда мы должны принять потерю для общего блага. Принятие и отпускание являются ключевыми, если вы когда-либо хотите двигаться вперед.',
            '12', 'high', 'Повешенный', null),
           ('14', 'Смерть означает завершение главы, оставление прошлого позади и удаление всего ненужного. Это также может означать переход или золотую середину между одной фазой жизни и следующей. Ключ в том, чтобы приветствовать карту Смерти в раскладе Таро, а не избегать ее. На какой путь число тринадцать пытается указать вам? Ведь нет нового начала без конца.',
            '13', 'high', 'Смерть', null),
           ('15', 'Умеренность на самом деле является навыком, и, как и любой другой навык, совершенство достигается практикой. Воздержитесь от поспешных суждений. Не поддавайтесь искушению реагировать немедленно. Есть ли области вашей жизни, в которых вам нужно найти баланс? Могли бы вы извлечь пользу из того, что научились сохранять спокойствие в моменты стресса? Умеренность пришла, чтобы помочь вам найти в себе силы сделать это.',
            '14', 'high', 'Умеренность', null),
           ('16', 'Дьявол — карта иллюзии. Хотя у вас есть полный контроль над своей жизнью, убеждениями и выбором, карта Дьявола символизирует то, как зависимость, депрессия и нездоровые связи могут заставить вас чувствовать себя неуправляемыми. Даже социальные сети, физические упражнения и работа могут быть воплощены Дьяволом, когда их слишком много. Независимо от характера вашей конкретной проблемы, послание Дьявола ясно: перенаправьте свое внимание с удовлетворения желаний на действительно важные вещи.',
            '15', 'high', 'Дьявол', null),
           ('17', 'Башня означает полное разрушение. Как и со всеми потерями, это, вероятно, будет болезненный процесс. Это также может привести к новому началу. Прежде чем вы сможете внести эти позитивные изменения, вам придется сначала посмотреть правде в глаза о ситуации. Готовы ли вы снять шоры лицом к лицу с этим личным кризисом? Видеть сквозь иллюзии и отпускать то, что вы хотите видеть, — это самый первый шаг.',
            '16', 'high', 'Башня', null),
           ('18', 'Прохождение через что-то сложное может лишить нас ветра и заставить нас чувствовать, что все уже никогда не будет прежним. Это может быть правдой. Смерть, утрата, разбитое сердце и другие болезненные события могут навсегда изменить нас самих. Это не значит, что мы не можем построить что-то лучше. От чего вы пытаетесь исцелиться? Звезда хочет, чтобы вы открыли свое сердце, осознали свою внутреннюю силу и поверили, что лучшее еще впереди.',
            '17', 'high', 'Звезда', null),
           ('19', 'Луна в некотором смысле является предупреждением. Вы раки, поднимающиеся из моря. Если вы доверитесь своей интуиции и будете двигаться вперед, вы получите освобождение от того, что вас связывает. Но сначала вы должны быть готовы взглянуть правде в глаза. Луна в вертикальном положении также может быть иллюзией. В вашей жизни может быть скрытая правда, которую вам нужно раскрыть. Луна предостерегает вас от принятия вещей такими, какими они кажутся. Возможно, пришло время копнуть немного глубже и позволить свету пролить свет на заблуждения в вашей жизни.',
            '18', 'high', 'Луна', null),
           ('20', 'Солнце напоминает нам смотреть на светлую сторону вещей и напоминает себе, что трудные времена не длятся вечно. Даже когда мы сталкиваемся с трудностями, мы можем выбрать «делать лимонад из лимонов» и принимать жизненные уроки такими, какие они есть: инструментами обучения. С этими уроками за плечами борьба и печаль скоро останутся в прошлом, и вы перейдете к более ярким и лучшим дням.',
            '19', 'high', 'Солнце', null),
           ('21', 'Сейчас идеальное время, чтобы взвесить свои действия и убедиться, что они соответствуют вашим ценностям и убеждениям. То, что вы делали в прошлом или делаете сегодня, отражают ваши основные ценности и убеждения? Направляют ли они вас к вашим целям и задачам? Без ясности знания того, кто вы есть на самом деле, вы не сможете ответить на эти вопросы. Найдите время, чтобы подумать о вещах, прежде чем продолжать свою жизнь. В конце концов, это того стоит.',
            '20', 'high', 'Страшный суд', null),
           ('22', 'Означает, что долгосрочный проект, период учебы или любое другое важное событие в вашей жизни прошли полный круг, и вы достигли своих целей и стремлений. Несмотря на трудности и трудности, с которыми вы столкнулись, вы стояли твердо и упорно. Семена, которые вы посадили, сейчас цветут, и вы пожинаете плоды своего труда. Все сошлось, и вы находитесь в нужном месте, делаете правильные вещи, достигаете того, что задумали. Гордитесь тем, что вы узнали на этом пути, прогрессом, которого вы добились, и своими достижениями на данный момент. Размышление о том, что вы уже сделали, может быть именно тем, что вам нужно, чтобы довести свой проект до конца.',
            '21', 'high', 'Мир', null),

           ('23', 'Олицетворяет баланс, который очень легко разрушить. Она советует не брать на себя больше, чем можете унести.',
            '2', 'low', null, 'Пентакли'),
           ('24', 'Рекомендует наладить отношения с коллегами и научиться работать в команде.',
            '3', 'low', null, 'Пентакли'),
           ('25', 'Напоминает, что нельзя думать только о деньгах, необходимо думать и о других сферах жизни.',
            '4', 'low', null, 'Пентакли'),
           ('26', 'Советует не сдаваться и смело преодолевать все препятствия, образовавшиеся на вашем пути.',
            '5', 'low', null, 'Пентакли'),
           ('27', 'Напоминает, что иногда стоит забыть о корысти и помочь нуждающимся, не требуя от них ничего взамен.',
            '6', 'low', null, 'Пентакли'),
           ('28', 'Рекомендует не бояться трудностей, так как они сделают вас еще сильнее.',
            '7', 'low', null, 'Пентакли'),
           ('29', 'Говорит о том, что вам придется потрудиться, чтобы добиться поставленных целей, не ждите чуда.',
            '8', 'low', null, 'Пентакли'),
           ('30', 'Напоминает, что труд всегда вознаграждается. Если вы усердно работали, то скоро будете пожинать плоды.',
            '9', 'low', null, 'Пентакли'),
           ('31', 'Советует перестать жить только настоящим и задуматься о будущем.',
            '10', 'low', null, 'Пентакли'),
           ('32', 'Сигнализирует о том, что сейчас идеальное время, чтобы начать действовать.',
            'Паж', 'low', null, 'Пентакли'),
           ('33', 'Рекомендует избегать рисков, скорее всего, они не оправдаются.',
            'Рыцарь', 'low', null, 'Пентакли'),
           ('34', 'Сигнализирует о том, что пора пересмотреть приоритеты — не зацикливайтесь на своем материальном положении.',
            'Королева', 'low', null, 'Пентакли'),
           ('35', 'Если вам выпала эта карта, то следует прислушаться к своему наставнику.',
            'Король', 'low', null, 'Пентакли'),
           ('36', 'Предвещает перемены, которые могут коснуться всех сфер жизни.',
            'Туз', 'low', null, 'Пентакли'),

           ('37', 'Символизирует расширение возможностей человека, его стремление к приключениям и изучению нового.',
            '2', 'low', null, 'Жезлы'),
           ('38', 'Говорит о том, что придется приложить немало усилий, чтобы сделать шаг вперед, но он нельзя сдаваться.',
            '3', 'low', null, 'Жезлы'),
           ('39', 'сигнализирует, что скоро вы скоро обретете счастье и стабильность.',
            '4', 'low', null, 'Жезлы'),
           ('40', 'Может говорить о том, что скоро вы столкнетесь с конкуренцией. Примите вызов, чтобы улучшить собственные навыки, но постарайтесь не испытывать злобу.',
            '5', 'low', null, 'Жезлы'),
           ('41', 'Говорит о том, что благодаря упорству и таланту вам удалось добиться всех поставленных целей.',
            '6', 'low', null, 'Жезлы'),
           ('42', 'Вы стремительно двигаетесь к своей цели и уже добились каких-то высот. Чтобы сохранить положение, вам необходимо преодолеть препятствия. Если вы будете преданы своим мечтам, то сможете справиться с любыми проблемами.',
            '7', 'low', null, 'Жезлы'),
           ('43', 'Трудности остались позади. Впереди вас ждет светлое будущее. Будьте готовы к переменам.',
            '8', 'low', null, 'Жезлы'),
           ('44', 'Вероятно, вы преодолели немало трудностей, однако препятствия на вашем пути еще не закончились. Не стоит отчаиваться. Карта сигнализирует о том, что еще есть надежда на успех. Главное не сдаваться, осталось сделать последний шаг.',
            '9', 'low', null, 'Жезлы'),
           ('45', 'Вы потратили много ресурсов и энергии на преодоление препятствий на своем жизненном пути. К счастью, старания были вознаграждены, и вы получили то, что хотели. Однако не время расслабляться. Карта рекомендует правильно расставить приоритеты и морально подготовиться к тому, что в вашей жизни могут появиться проблемы.',
            '10', 'low', null, 'Жезлы'),
           ('46', 'Карта говорит о том, что вы справитесь с препятствиями и реализуете свои идеи. Проявите смелость.',
            'Паж', 'low', null, 'Жезлы'),
           ('47', 'Сигнализирует о том, что пришло время путешествовать, поменять работу или переехать. Несмотря на зашкаливающий энтузиазм, не принимайте спонтанные решения. Составьте четкий план действий и оцените риски.',
            'Рыцарь', 'low', null, 'Жезлы'),
           ('48', 'Будьте общительны и открыты с людьми вокруг вас, особенно с близкими и родными.',
            'Королева', 'low', null, 'Жезлы'),
           ('49', 'Король - прирожденный лидер. Как только он поставит себе цель, будет неотступно двигаться к ней.',
            'Король', 'low', null, 'Жезлы'),
           ('50', 'Сигнализирует о том, что пора набраться смелости и начать двигаться к своей мечте.  Доверьтесь интуиции и начните реализовывать творческие идеи.',
            'Туз', 'low', null, 'Жезлы'),

           ('51', 'Сигнализирует о выборе пути. Это решение способно кардинально изменить жизнь, поэтому следует хорошо подумать.',
            '2', 'low', null, 'Мечи'),
